script: |
  super -f text -I q7139.spq | sort > q7139.out

inputs:
  - name: q7139.spq
    data: |
      SELECT ALL - + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 + - col1 + - - col1 + + 22 * col1 - col1 + - 75 NOT BETWEEN - col0 AND 1;
  - name: tab0

outputs:
  - name: q7139.out
    data: |
